import React from 'react'

const CartComponent = ({currentCart}) => {
    console.log(currentCart);
    return (
        <div>
            {
                currentCart.map((cart)=>{
                    return (
                        <div className="image">
                            <img src={cart.avatar_url} className="rounded" width="155"/>

                        </div>
                    )
                })
            }

        </div>
    )
}

export default CartComponent
